import React, { useState } from "react";
import FormEditModal from "./FormEditModal";

export default function FormTable({ forms, onEdit }) {
  const [selectedForm, setSelectedForm] = useState(null);

  const handleEditClick = form => {
    setSelectedForm(form);
  };

  const handleCloseModal = () => setSelectedForm(null);

  const handleSave = updatedForm => {
    onEdit(updatedForm);
    setSelectedForm(null);
  };

  return (
    <div className="bg-white rounded-lg shadow-md p-6 mt-6 overflow-x-auto">
      <table className="min-w-full divide-y divide-gray-200">
        <thead className="bg-gray-50">
          <tr>
            {[
              "National ID",
              "Gender",
              "First Name",
              "Father Name",
              "Grandfather Name",
              "Last Name",
              "Phone",
              "Region",
              "Area",
              "Institute",
              "Profession",
              "How Did He Hear About Us",
              "Actions"
            ].map((header, index) => (
              <th 
                key={index} 
                className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider"
              >
                {header}
              </th>
            ))}
          </tr>
        </thead>
        <tbody className="bg-white divide-y divide-gray-200">
          {forms.map(form => (
            <tr key={form.id} className="hover:bg-gray-50">
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{form.nationalID}</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{form.gender}</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{form.firstName}</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{form.fatherName}</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{form.grandFatherName}</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{form.lastName}</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{form.phoneNumber}</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{form.region}</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{form.area}</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{form.institue}</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{form.profession}</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{form.howDidYouHearAboutUs}</td>
              <td className="px-6 py-4 whitespace-nowrap text-sm font-medium">
                <button 
                  onClick={() => handleEditClick(form)}
                  className="text-indigo-600 hover:text-indigo-900"
                >
                  Edit
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {selectedForm && (
        <FormEditModal
          form={selectedForm}
          onClose={handleCloseModal}
          onSave={handleSave}
        />
      )}
    </div>
  );
}
